import React from "react";
import { createRoot } from "react-dom/client"
import { BrowserRouter as Router } from "react-router-dom"
import App from "./App";
import './index.css'


const container = document.querySelector("#root");
const root = createRoot(container);

root.render(
    <Router>
        <App />
    </Router>
)
